import React, { useState } from 'react'
import '../components/css/TinderCards.css'

function TinderCards() {
	const [people, setPeople] = useState([
		{
			name: 'Elon Musk',
			url: 'https://images.hdqwalls.com/wallpapers/elon-musk-4k-rq.jpg'
		},
		{
			name: 'Jeff Bezos',
			url: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.kindpng.com%2Fimgv%2FiRmRooR_jeff-bezos-investor-jeff-bezos-warren-buffett-quote%2F&psig=AOvVaw0Tw5ps4rVRFsGBocKsCx_F&ust=1600773323450000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKC5-sSP-usCFQAAAAAdAAAAABAD'
		},
	]);

	return (
		<section className="tinder-cards">
			{people.map((person) => (
				<h3>{person.name}</h3>
			))}
		</section>
	)
}

export default TinderCards
